TCHAR SjisToUnicode(TCHAR sjis)
{
	for(int i=0; conversion_table[i].sjis!=NULL; i++)
		if(sjis==conversion_table[i].sjis)
			return conversion_table[i].unicode;
	return(_T('？'));
}

USHORT UnicodeToSjis(TCHAR unicode)
{
	for(int i=0; i<conversion_table[i].unicode!=NULL; i++)
		if(unicode==conversion_table[i].unicode)
			return conversion_table[i].sjis;
	return UnicodeToSjis(_T('？'));
}